// src/App.js
import { BrowserRouter, Routes, Route, Navigate, Outlet } from "react-router-dom";
import { useState, useEffect } from "react";
import TopNav from "./components/TopNav";
import VendorDashboard from "./components/VendorDashboard";
import RetailAnalyticsPage from "./components/RetailAnalyticsPage";
import InventoryPage from "./components/InventoryPage";
import ShippedRevenuePage from "./components/ShippedRevenuePage";
import CatalogPage from "./components/CatalogPage";
import MenuBar from "./components/MenuBar";
import LoginPage from "./components/LoginPage";
import InvoiceTable from "./components/InvoiceTable";
import RemittancePaymentsPage from "./components/RemittancePaymentsPage";

// Layout with TopNav and Sidebar
function AppLayout({ children }) {
  const [menuOpen, setMenuOpen] = useState(false);

  return (
    <div>
      <TopNav onMenuClick={() => setMenuOpen(true)} />
      {menuOpen && (
        <>
          <div
            className="fixed inset-0 bg-black bg-opacity-40 z-40"
            onClick={() => setMenuOpen(false)}
          />
          <div className="fixed top-0 left-0 h-full w-[320px] bg-white shadow-lg z-50 p-4">
            <div className="flex items-center justify-between mb-4">
              <h2 className="text-lg font-bold">Menu</h2>
              <button
                onClick={() => setMenuOpen(false)}
                className="text-2xl font-bold"
              >
                &times;
              </button>
            </div>
            <MenuBar onLinkClick={() => setMenuOpen(false)} />
          </div>
        </>
      )}
      {children}
    </div>
  );
}

// Protected Route wrapper
function ProtectedRoute() {
  const [isAuth, setIsAuth] = useState(localStorage.getItem("vc_logged_in") === "true");

  useEffect(() => {
    const checkAuth = () => {
      setIsAuth(localStorage.getItem("vc_logged_in") === "true");
    };
    window.addEventListener("storage", checkAuth);
    return () => window.removeEventListener("storage", checkAuth);
  }, []);

  return isAuth ? <Outlet /> : <Navigate to="/login" replace />;
}

function AppRoutes() {
  const isLoggedIn = localStorage.getItem("vc_logged_in") === "true";

  return (
    <Routes>
      {/* Login Route - redirect if already logged in */}
      <Route
        path="/login"
        element={isLoggedIn ? <Navigate to="/" replace /> : <LoginPage />}
      />

      {/* Protected Routes */}
      <Route element={<ProtectedRoute />}>
        <Route element={<AppLayout><Outlet /></AppLayout>}>
          <Route path="/" element={<VendorDashboard />} />
          <Route path="/retail-analytics" element={<RetailAnalyticsPage />} />
          <Route path="/inventory" element={<InventoryPage />} />
          <Route path="/shipped-revenue" element={<ShippedRevenuePage />} />
          <Route path="/catalog" element={<CatalogPage />} />
          <Route path="/invoice-management" element={<InvoiceTable />} />
          <Route path="/remittance-payments" element={<RemittancePaymentsPage />} />
        </Route>
      </Route>

      {/* Fallback route */}
      <Route path="*" element={<Navigate to="/login" replace />} />
    </Routes>
  );
}

export default function App() {
  return (
    <BrowserRouter>
      <AppRoutes />
    </BrowserRouter>
  );
}
